- input: "TEXT\x1CC00019331\x1CTEXT-00001\x1C\x1CF3XA\x1CThis amended filing responds
    to the Commission's RFAIs of February 26 and March 24, 2010. Some transfers from
    the Democratic National Committee's State Partnership Program were incorrectly
    identified as proceeds from the WI Party Victory Fund joint fundraising program
    on the committee's June 2009 monthly through 2009 year-end reports. Records correction
    propagated errors in the reported year-to-date totals over this period. This amendment
    corrects those entries and makes consistent the reported year-to-date totals.
    \ Payroll-related items on Schedule H4 of this report were for employees that
    spent 25% or less of their compensated time on Federal activity. Any receipts
    on lines 15 or 17 were assessed at the usual and normal charge. Any fundraising
    expenses on line 21b were for the benefit of the committee and did not support
    a federal candidate. The receipts on Schedule A, supporting line 11, from unregistered
    committees Friends of Mark Miller, Friends of Mary Hubler, and Friends of Nick
    Milroy have been deemed permissible. These contributions were made by non-Federal
    candidates that had the required funds from Federally-permissible sources. The
    funds were verified to have come from permissible sources, and no amount exceeded
    the $1,000 threshold that would require the committees to register with the Commission.\n"
